export default (function(a,b,c,d,e,f,g,h,i){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:5}}},QLhDflJCbt:{data:{id:120,attributes:{imdbId:"tt3410834",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNjk2OTc5YzQtMjAwMS00YWY4LTk1ZWItOTgyMmRkMGU4ZmY1XkEyXkFqcGdeQXVyMzQ1MzUwMTE@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"5.7\u002F10"},{Source:"Rotten Tomatoes",Value:"11%"},{Source:"Metacritic",Value:"33\u002F100"}],item_lang:{data:{id:783,attributes:{title:g,plot:"After the earth-shattering revelations of INSURGENT, Tris must escape with Four and go beyond the wall enclosing Chicago. For the first time ever, they will leave the only city and family they have ever known. Once outside, old discoveries are quickly rendered meaningless with the revelation of shocking new truths. Tris and Four must quickly decide who they can trust as a ruthless battle ignites beyond the walls of Chicago which threatens all of humanity. In order to survive, Tris will be forced to make impossible choices about courage, allegiance, sacrifice and love.",slug:"allegiant"}}},books:{data:[{id:2213,attributes:{title:g,description:"The faction-based society that Tris Prior once believed in is shattered - fractured by violence and power struggles and scarred by loss and betrayal. So when offered a chance to explore the world past the limits she's known, Tris is ready. Perhaps beyond the fence, she and Tobias will find a simple new life together, free from complicated lies, tangled loyalties, and painful memories. But Tris's new reality is even more alarming than the one she left behind. Old discoveries are quickly rendered meaningless. Explosive new truths change the hearts of those she loves. And once again, Tris must battle to comprehend the complexities of human nature - and of herself - while facing impossible choices about courage, allegiance, sacrifice and love.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=VodsmQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:true,published:"2013-01-01",publisher:"HarperCollins Children's Books",subtitle:d}},{id:2214,attributes:{title:"Allegiant (Divergent, Book 3)",description:"What if your whole world was a lie? The thrillingly dark conclusion to the No. 1 New York Times bestselling DIVERGENT trilogy.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=v5MH3ER4SWEC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:h,publisher:"HarperCollins UK",subtitle:d}},{id:2215,attributes:{title:"Divergent Series Complete Box Set",description:"Veronica Roth's entire Divergent trilogy is available together for the first time, with a bonus booklet about the series. Perfect for gift givers, collectors, and fans new to the series, the complete collection includes the full text of Divergent, Insurgent, and Allegiant, plus \"The World of Veronica Roth's Divergent Series,\" a forty-eight-page booklet including faction manifestos, a faction quiz and results, a Q&A with Veronica Roth, playlists, discussion questions, series inspirations, and much more! Divergent: One choice can transform you. Veronica Roth's #1 New York Times bestselling debut is a gripping dystopian tale of electrifying choices, powerful consequences, unexpected romance, and a deeply flawed \"perfect society.\" Insurgent: One choice can destroy you. Veronica Roth's second #1 New York Times bestseller continues the dystopian thrill ride. As war surges in the factions all around her, Tris attempts to save those she loves—and herself—while grappling with haunting questions of grief and forgiveness, identity and loyalty, politics and love. Allegiant: The explosive conclusion to Veronica Roth's #1 New York Times bestselling Divergent trilogy reveals the secrets of the dystopian world that has captivated millions of readers in Divergent and Insurgent.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Vt9JmQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:h,publisher:i,subtitle:d}},{id:2216,attributes:{title:"Divergent Series Four-Book Paperback Box Set",description:"The definitive box set for Divergent fans! This four-book set includes paperbacks of the three books in the #1 New York Times bestselling Divergent trilogy, plus the companion volume told from the perspective of the immensely popular character Tobias, all wrapped up in a dazzling keepsake box. This set is perfect for established fans who want to own the full Divergent library, readers new to the series, or fans of the blockbuster films starring Shailene Woodley, Theo James, and Kate Winslet. Divergent: One choice can transform you. Veronica Roth's debut is a gripping dystopian tale of electrifying choices, powerful consequences, unexpected romance, and a deeply flawed \"perfect society.\" Includes bonus materials by Veronica Roth. Insurgent: One choice can destroy you. The second bestseller continues the dystopian thrill ride. As war surges in the factions all around her, Tris attempts to save those she loves—and herself—while grappling with haunting questions of grief and forgiveness, identity and loyalty, politics and love. Includes bonus materials by Veronica Roth. Allegiant: One choice will define you. The explosive conclusion to the #1 New York Times bestselling Divergent trilogy reveals the secrets of the dystopian world that has captivated millions of readers. Includes bonus materials by Veronica Roth. Four: A Divergent Collection: A companion volume to the worldwide bestselling Divergent series, told from the perspective of Tobias. The four pieces included—\"The Transfer,\" \"The Initiate,\" \"The Son,\" and \"The Traitor\"—plus three additional scenes, give readers a fascinating glimpse into the history and heart of Tobias, and set the stage for the epic saga of the Divergent trilogy.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=a9khswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:"2016-01-19",publisher:i,subtitle:"Divergent, Insurgent, Allegiant, Four"}},{id:2217,attributes:{title:"Divergent Series Ultimate Four-Book Collection",description:"Available together for the first time—all three books in the #1 New York Times bestselling Divergent trilogy, plus the companion volume told from the perspective of the immensely popular character Tobias. Perfect for established fans who want to own the full Divergent library or readers new to the series, this ebook bundle includes Divergent, Insurgent, Allegiant, and Four: A Divergent Collection. Divergent: One choice can transform you. Veronica Roth's #1 New York Times bestselling debut is a gripping dystopian tale of electrifying choices, powerful consequences, unexpected romance, and a deeply flawed \"perfect society.\" Insurgent: One choice can destroy you. Veronica Roth's second #1 New York Times bestseller continues the dystopian thrill ride. As war surges in the factions all around her, Tris attempts to save those she loves—and herself—while grappling with haunting questions of grief and forgiveness, identity and loyalty, politics and love. Allegiant: The explosive conclusion to Veronica Roth's #1 New York Times bestselling Divergent trilogy reveals the secrets of the dystopian world that has captivated millions of readers. Four: A Divergent Collection: A companion volume to the worldwide bestselling Divergent series, told from the perspective of Tobias. The four pieces included—\"The Transfer,\" \"The Initiate,\" \"The Son,\" and \"The Traitor\"—plus three additional exclusive scenes, give readers a fascinating glimpse into the history and heart of Tobias, and set the stage for the epic saga of the Divergent trilogy. And don't miss The Fates Divide, Veronica Roth's powerful sequel to the bestselling Carve the Mark!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=tTMGAwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2014-07-08",publisher:"Harper Collins",subtitle:"Divergent; Insurgent; Allegiant; Four"}}]}}},meta:{}}},prerenderedAt:1681309120365}}("Veronica Roth","movie",null,"","series",1,"Allegiant","2013-10-22","Katherine Tegen Books"))